import './Header.css';

const Header = () => {
    return (
        <nav className="navbar bg-dark">
            <div className="container-fluid">
                <div className="navbar-brand text-white">
                    <img src="/img/Logo.jpg" alt="Logo" width="30" height="24" className="user-avatar d-inline-block align-text-top" />
                    XXGaming
                </div>
            </div>
        </nav>
    );
}

export default Header;
